create table workers
(
    id             integer,
    name           text,
    last_name      text,
    second_name    text,
    active         boolean,
    work_position  text,
    last_login     text,
    date_register  text,
    personal_photo text
);

alter table workers
    owner to meadowse;

grant select on workers to readonly;

grant delete, insert, select, update on workers to readwrite;

